import css from "styled-jsx/css";

export default css`
  ul {
    display: flex;
    width: 60vh;
    justify-content: space-around;
    list-style: none;
    font-family: Verdana;
    border-bottom: 1px solid lightgrey;
    padding-bottom: 2px;
  }

  a {
    text-decoration: none;
  }

  li:hover {
    border-bottom: 2px solid grey;
  }
`;
